import React from 'react';

function Host(name,picture) {
    const split_string = name.split(" ");
    return(
        <div className='Profile'>
            <div className='Profile-text'>
                <p>
                    {split_string[0]}
                </p>
                <p>
                    {split_string[1]}
                </p>
            </div>
            <div className='Profile-picture'>
                <img>{picture}</img>
            </div>
        </div>
    )
}

export default Host;
